import React, { Component } from "react";

class Table extends Component {
  state = {};
  render() {
    const { activities } = this.props;

    return (
      <table>
        <thead>
          <tr>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {activities.forEach((element) => {
            <tr>element.map((key,))</tr>;
          })}
        </tbody>
      </table>
    );
  }
}

export default Table;
